import React, { Component } from "react";

const style = {
  container: {
    width: "100%",
    minheight: 80,
    backgroundImage: 'linear-gradient(to left, #00b6be, #00a6e0, #0090ff, #006eff, #5e17ff)',
    // backgroundColor: "#FF5F5F",
    borderRadius: '5px 5px 0px 0px',
    display: "flex",
    alignItems: "center",
    justifyContent: "center",
    marginTop: -85
  },
  title: {
    fontWeight: "lighter",
    textAlign: "center",
    margin: 0,
    padding: 0,
    color: "#ffffff",
    fontSize: 20
  }
};

export class TodoMainTitle extends Component {
  render() {
    return (
      <div style={style.container}>
        <h6 style={style.title}>{"Task manager"}</h6>
      </div>
    );
  }
}

export default TodoMainTitle;
